import React from 'react';
import './App.css';
import { ListContainer } from './components/List/List';

function App() {
  return (
    <div className='main-container'>
      <div className='title'>Daily To-Do List</div>
      <ListContainer title='Home'/>
    </div>
  );
}

export default App;
